import Foundation

struct Rank: Identifiable, Hashable {
    var id = UUID().uuidString
    var level: Int = 0
    var rank: Int = 0
    var badge: String = "badge9"
    var username: String
    var pfp: String
    var cc: String
    var score: Int
    
    init(_ i: Int) {
        self.rank = i
        self.username = allUsers[i]
        self.pfp = allPFPs[i]
        self.cc = allCCs[i]
        self.score = allScores[i]
    }
    
    init(rank: Int, username: String, pfp: String, cc: String, score: Int) {
        self.rank = rank
        self.username = username
        self.pfp = pfp
        self.cc = cc
        self.score = score
    }
    
    init(rank: Int, username: String, pfp: String, cc: String, score: Int, badge: String) {
        self.rank = rank
        self.username = username
        self.pfp = pfp
        self.cc = cc
        self.score = score
        self.badge = badge
    }
}


